import ReactDOM from 'react-dom';
import React from 'react';
import './index.css';

class TTT extends React.Component{
    render(){
        const name  = "Humayun Anwar Khan";
        return(
            <div className='name'>Hello {name}</div>
        );
    }
}


ReactDOM.render(<TTT/>,document.getElementById("root"));
